import React from 'react'
import laptop from '../assets/laptop.jpg'

const Analytics = () => {
  return (
    <div className=' w-full bg-white py-16 px-4'>
        <div className=' bg-blue-500 max-w-[1240px] mx-auto grid md:grid-cols-2'>
            <img src={laptop} alt="/" />
        </div>
    </div>
  )
}

export default Analytics
